    false,nt"url": null,nt"notes": "This report is the result of the Austin
    City Code 6-7u2019s Energy Conservation Audit and Disclosure Ordinance approved
    in November 2008 (amended in April 2011) to improve the energy efficiency of homes
    and buildings that receive electricity from Austin Energy.  The ordinance meets
    one of the goals of the Austin Climate Protection Plan, which is to offset 800 megawatts
    of peak energy demand by 2020. In addition, this report contains information on
    multi-family properties older than 10 years that are required to perform an energy
    audit and report the results to the City of Austin and all residents living in those
    communities. The Austin Energy report quantifies the 2015 energy efficiency findings
    and the progress towards meeting City Council goals of Resolution 20081106-048.",nt"license_title":
